import React, { Component } from "react";

const Details = ({ data }) => {
  console.log(data);
  return (
    <div className="border bg-light p-3 ">
      <div className="row" style={{ justifyContent: "center" }}>
        {data.map((year) => (
          <div class="card" style="width: 18rem"></div>
        ))}
      </div>
    </div>
  );
};

export default Details;
